import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import Navbar from "./Navbar";

const PaymentPage = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const [paymentMethod, setPaymentMethod] = useState("");
  const [formData, setFormData] = useState({});

  const purchasedItem = location.state?.item;

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleConfirm = () => {
    if (!paymentMethod) {
      alert("Please select a payment method.");
      return;
    }

    // Simulate saving the order
    const orders = JSON.parse(localStorage.getItem("orders")) || [];
    localStorage.setItem("orders", JSON.stringify([...orders, purchasedItem]));

    // Show success popup
    alert("Your purchase was successful!");

    // Navigate to Orders page
    navigate("/orders");
  };

  return (
    <div>
      <Navbar />
      <div className="p-6 bg-gray-100 min-h-screen">
        <h1 className="text-3xl font-bold mb-6">Payment</h1>

        {purchasedItem && (
          <div className="bg-white rounded shadow p-4 mb-6">
            <img
              src={purchasedItem.image}
              alt={purchasedItem.name}
              className="w-full h-48 object-cover rounded mb-4"
            />
            <h2 className="text-xl font-bold mb-2">{purchasedItem.name}</h2>
            <p className="text-gray-700 mb-4">{purchasedItem.description}</p>
          </div>
        )}

        <div className="space-y-4">
          <label className="block">
            <input
              type="radio"
              name="payment"
              value="Card"
              onChange={(e) => setPaymentMethod(e.target.value)}
              className="mr-2"
            />
            Card Payment
          </label>
          <label className="block">
            <input
              type="radio"
              name="payment"
              value="UPI"
              onChange={(e) => setPaymentMethod(e.target.value)}
              className="mr-2"
            />
            UPI Payment
          </label>
          <label className="block">
            <input
              type="radio"
              name="payment"
              value="Net Banking"
              onChange={(e) => setPaymentMethod(e.target.value)}
              className="mr-2"
            />
            Net Banking
          </label>
        </div>

        {paymentMethod === "Card" && (
          <div className="mt-6 space-y-4">
            <input
              type="text"
              name="cardHolder"
              placeholder="Card Holder Name"
              onChange={handleInputChange}
              className="w-full px-4 py-2 border rounded"
            />
            <input
              type="text"
              name="cardNumber"
              placeholder="Card Number"
              onChange={handleInputChange}
              className="w-full px-4 py-2 border rounded"
            />
            <input
              type="text"
              name="expiryDate"
              placeholder="Expiry Date (MM/YY)"
              onChange={handleInputChange}
              className="w-full px-4 py-2 border rounded"
            />
            <input
              type="password"
              name="cvv"
              placeholder="CVV"
              onChange={handleInputChange}
              className="w-full px-4 py-2 border rounded"
            />
          </div>
        )}

        {paymentMethod === "UPI" && (
          <div className="mt-6 space-y-4">
            <input
              type="text"
              name="upiId"
              placeholder="UPI ID"
              onChange={handleInputChange}
              className="w-full px-4 py-2 border rounded"
            />
          </div>
        )}

        {paymentMethod === "Net Banking" && (
          <div className="mt-6 space-y-4">
            <input
              type="text"
              name="bankName"
              placeholder="Bank Name"
              onChange={handleInputChange}
              className="w-full px-4 py-2 border rounded"
            />
            <input
              type="text"
              name="accountNumber"
              placeholder="Account Number"
              onChange={handleInputChange}
              className="w-full px-4 py-2 border rounded"
            />
          </div>
        )}

        <button
          onClick={handleConfirm}
          className="mt-6 px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600"
        >
          Confirm
        </button>
      </div>
    </div>
  );
};

export default PaymentPage;
